import React from 'react';
import './styles.scss';
import RegisterApi from 'api/registerAPI';
import RegisterContext from 'api/context/RegisterContext';


export default function Register() {

  return(
   <RegisterContext.Provider>
     <div className="register">
       <RegisterApi />
     </div>
   </RegisterContext.Provider>
);
}
